import React, { useEffect, useState } from 'react';

const ContactDetails = () => {
  const [feedbacks, setFeedbacks] = useState([]);

  useEffect(() => {
    const fetchFeedbacks = async () => {
      try {
        const response = await fetch('http://localhost:3001/feedbacks');
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        const data = await response.json();
        setFeedbacks(data);
      } catch (error) {
        console.error('Error fetching feedbacks:', error);
      }
    };

    fetchFeedbacks();
  }, []);

  return (
    <>
      <div className="container mx-auto p-4 mt-8">
        <div className="text-center mb-8">
          <h1 className="text-4xl font-bold mb-4">Welcome, Admin!</h1>
          <p className="text-lg">Here are some important Feedbacks</p>
        </div>

        {/* Fixed header row for Aspect, Satisfaction Level, and Improvement Suggestions */}
        <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
          {/* Name Header */}
          <div className="bg-blue-100 p-6 rounded-lg shadow-lg text-center">
            <h2 className="text-xl font-bold text-blue-800">Name</h2>
          </div>

          {/* Email Header */}
          <div className="bg-green-200 p-6 rounded-lg shadow-lg text-center">
            <h2 className="text-xl font-bold text-green-800">Email</h2>
          </div>

          {/* Message Headers */}
          <div className="bg-purple-200 p-6 rounded-lg shadow-lg text-center">
            <h2 className="text-xl font-bold text-purple-800">Message</h2>
          </div>
          <div className="bg-purple-200 p-6 rounded-lg shadow-lg text-center">
            <h2 className="text-xl font-bold text-purple-800">Answer</h2>
          </div>
        </div>

        {/* Feedback data displayed below the headers */}
        <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
          {feedbacks.map((feedback) => (
            <React.Fragment key={feedback.id}>
              {/* Name */}
              <div className="bg-gray-100 p-6 rounded-lg shadow-lg">
                <div className="mt-2">
                  <p>{feedback.aspect}</p>
                </div>
              </div>

              {/* Email */}
              <div className="bg-gray-100 p-6 rounded-lg shadow-lg">
                <div className="mt-4">
                  <pre>{JSON.stringify(JSON.parse(feedback.satisfaction_level), null, 2)}</pre>
                </div>
              </div>

              {/* Message */}
              <div className="bg-gray-100 p-6 rounded-lg shadow-lg">
                <div className="mt-4">
                  <p>{feedback.improvement_suggestions}</p>
                </div>
              </div>
            </React.Fragment>
          ))}
        </div>
      </div>
    </>
  );
};

export default ContactDetails;
